package com.mzbr.videoeditingservice.model;public class testEx extends RuntimeException {	public testEx() {	}	public testEx(String message) {		super(message);	}	public testEx(String message, Throwable cause) {		super(message, cause);	}	public testEx(Throwable cause) {		super(cause);	}	public testEx(String message, Throwable cause, boolean enableSuppression, boolean writableStackTrace) {		super(message, cause, enableSuppression, writableStackTrace);	}}